import React, { Component } from 'react'
import {ProductConsumer} from '../../contextAPI';

export default class CheckoutList extends Component {
    render() {
        return (
            <section>
                <ProductConsumer>
                    {value => {
                        const {cart} = value;
                        cart.map((item,index) => {
                        return <h1>{item}</h1>
                        })
                    }}
                </ProductConsumer>
            </section>
        )
    }
}
